        "\n",
        "        x = np.arange(len(model_names))\n",
        "        axes[0, 0].bar(x - 0.2, train_rmse, 0.4, label='Train RMSE', alpha=0.8)\n",
        "        axes[0, 0].bar(x + 0.2, test_rmse, 0.4, label='Test RMSE', alpha=0.8)\n",
