        "def main():\n",
        "    \"\"\"Main execution pipeline\"\"\"\n",
        "\n",
        "    print(\"\\n\" + \"=\"*70)\n",
        "    print(\"SUPPLY CHAIN ML MODEL TRAINING PIPELINE\")\n",
        "    print(\"=\"*70 + \"\\n\")\n",
        "\n",
        "    # Step 1: Load and preprocess data\n",
        "    preprocessor = SupplyChainDataPreprocessor()\n",
        "    df = preprocessor.load_and_prepare_data('Train.csv')\n",
        "\n",
        "    # Step 2: Feature engineering\n",
        "    df_fe = preprocessor.engineer_features(df)\n",
        "    df_fe = preprocessor.encode_categorical(df_fe, fit=True)\n",
        "\n",
        "    # Step 3: Create target variables\n",
        "    df_complete = preprocessor.create_synthetic_targets(df_fe)\n",
        "\n",
        "    # Step 4: Define features\n",
        "    feature_cols = [\n",
        "        'Cost_of_the_Product', 'Weight_in_gms', 'Prior_purchases',\n",
        "        'Customer_care_calls', 'Customer_rating', 'Discount_offered',\n",
        "        'Warehouse_block_encoded', 'Mode_of_Shipment_encoded',\n",
        "        'Product_importance_encoded', 'Gender_encoded',\n",
        "        'cost_per_gm', 'care_to_rating_ratio', 'is_loyal_customer',\n",
        "        'high_discount', 'discount_to_cost_ratio', 'product_value',\n",
        "        'shipment_weight_interaction', 'importance_cost_interaction'\n",
        "    ]\n",
        "\n",
        "    # Step 5: Train models\n",
        "    trainer = SupplyChainMLTrainer()\n",
        "    visualizer = ModelVisualizer()\n",
        "\n",
        "    targets = {\n",
        "        'Transportation_Cost': 'Transportation Cost ($)',\n",
        "        'Delivery_Time_Hours': 'Delivery Time (Hours)',\n",
        "        'Warehouse_Utilization': 'Warehouse Utilization (%)'\n",
        "    }\n",
        "\n",
        "    trained_models = {}\n",
        "\n",
        "    for target_col, target_name in targets.items():\n",
        "        # Prepare data\n",
        "        X_train, X_test, y_train, y_test, features = trainer.prepare_train_test(\n",
        "            df_complete, target_col, feature_cols\n",
        "        )\n",
        "\n",
        "        # Train models\n",
        "        results, y_test_actual = trainer.train_models(\n",
        "            X_train, X_test, y_train, y_test, target_name\n",
        "        )\n",
        "\n",
        "        # Select best model\n",
        "        best_name, best_model = trainer.select_best_model(results, target_name)\n",
        "        trained_models[target_col] = {\n",
        "            'model': best_model,\n",
        "            'model_name': best_name,\n",
        "            'scaler': trainer.scaler,\n",
        "            'features': features\n",
        "        }\n",
        "\n",
        "        # Feature importance\n",
        "        feat_names, feat_imp = trainer.get_feature_importance(\n",
        "            best_model, np.array(features)\n",
        "        )\n",
        "\n",
        "        # Visualizations\n",
        "        visualizer.plot_model_comparison(results, y_test_actual, target_name)\n",
        "        if feat_names is not None:\n",
        "            visualizer.plot_feature_importance(feat_names, feat_imp, target_name)\n",
        "\n",
        "    # Step 6: Customer clustering\n",
        "    segmentation = CustomerSegmentation(n_clusters=6)\n",
        "    df_complete, clusters = segmentation.perform_clustering(df_complete)\n",
        "    visualizer.plot_clusters(df_complete)\n",
        "\n",
        "    # Step 7: Save models\n",
        "    print(\"\\n\" + \"=\"*70)\n",
        "    print(\"SAVING TRAINED MODELS\")\n",
        "    print(\"=\"*70)\n",
        "\n",
        "    for target, model_info in trained_models.items():\n",
        "        filename = f\"model_{target.lower()}.pkl\"\n",
        "        joblib.dump(model_info, filename)\n",
        "        print(f\"✓ Saved: {filename}\")\n",
        "\n",
        "    # Save preprocessing objects\n",
        "    joblib.dump(preprocessor.label_encoders, 'label_encoders.pkl')\n",
        "    joblib.dump(segmentation.kmeans, 'customer_clustering_model.pkl')\n",
        "    print(f\"✓ Saved: label_encoders.pkl\")\n",
        "    print(f\"✓ Saved: customer_clustering_model.pkl\")\n",
        "\n",
        "    # Save processed data\n",
        "    df_complete.to_csv('processed_supply_chain_data.csv', index=False)\n",
        "    print(f\"✓ Saved: processed_supply_chain_data.csv\")\n",
        "\n",
        "    # Step 8: Generate summary report\n",
        "    print(\"\\n\" + \"=\"*70)\n",
        "    print(\"TRAINING SUMMARY\")\n",
        "    print(\"=\"*70)\n",
        "\n",
        "    for target, model_info in trained_models.items():\n",
        "        print(f\"\\n{target}:\")\n",
        "        print(f\"  Best Model: {model_info['model_name']}\")\n",
        "        print(f\"  Features Used: {len(model_info['features'])}\")\n",
        "\n",
        "    print(f\"\\nCustomer Segments Created: {segmentation.n_clusters}\")\n",
        "    print(f\"Total Records Processed: {len(df_complete)}\")\n",
        "\n",
        "    print(\"\\n\" + \"=\"*70)\n",
        "    print(\"✓ ML TRAINING PIPELINE COMPLETED SUCCESSFULLY!\")\n",
        "    print(\"=\"*70)\n",
        "\n",
        "    return trained_models, df_complete"
